import React from 'react'
import {Link} from 'react-router-dom';

// set image to the left and text to the right

const Intro = () => {
  const me_image = "../../imgs/me.jpg"
  return (
    <div className="intro-section">

        <div className="intro-image">
            <img src={me_image}/>
        </div>
        <div className="intro-text">
            <h1>Hi, I'm Inga!</h1>
            <p>I am a junior at UC Berkeley studying Electrical Engineering & Computer Science. I am a hardware hacker curious about wearable devices, machine learning, and the future of human-computer interaction using brain-computer interfaces.</p>
        </div>
    </div>
  )
}

export default Intro;
